DROP TABLE expenses;
CREATE TABLE expenses(
   Transaction_ID   INTEGER  NOT NULL PRIMARY KEY 
  ,Transaction_Type VARCHAR(7) NOT NULL
  ,Category         VARCHAR(21) NOT NULL
  ,Amount           INTEGER  NOT NULL
  ,Date_entered     CHAR(10) NOT NULL
  ,Season           VARCHAR(6) NOT NULL
  ,Weather          VARCHAR(5) NOT NULL
  ,Customer_ID      NUMERIC(6,1)
  ,Incident_ID      NUMERIC(5,1)
);
